    return (
        <div className={"w-[380px] bg-[#3D3B40] p-1"}>
            <div className="flex flex-row gap-3">
                <div className={"flex flex-col"}>
                    <div className={"w-6 h-1 bg-"}></div>
                </div>
                <div className={"bg-[#3D3B40] text-white p-2"}>Chats</div>
            </div>
            <SearchBar/>
            <ChatPreview/>
            <ChatPreview/>
        </div>
    );
}
export default Panel;
